import React from "react";
import Navbar from "../Navbar/Navbar";
import Box from '@mui/material/Box';

export default function Home() {
    return (
        <div>
            <Box >
                <Navbar />
                <Box component="main" sx={{ flexGrow: 1, p: 3 }} style={{
                    display: 'flex', 
                    alignItems: 'center',
                    justifyContent: 'flex-end',
                }} className="content">
                    <h1> Home </h1>
                </Box>
            </Box>
        </div>
    );
}
